package user;

public class Subscribe {
	private int subNo;
	private int subPrice;
	private String subDate;
	private String subExpiryDate;
	private int subMonths;
	private String userId;
	public Subscribe() {
		// TODO Auto-generated constructor stub
	}
	public Subscribe(int subNo, int subPrice, String subDate, String subExpiryDate, int subMonths, String userId) {
		this.subNo = subNo;
		this.subPrice = subPrice;
		this.subDate = subDate;
		this.subExpiryDate = subExpiryDate;
		this.subMonths = subMonths;
		this.userId = userId;
	}
	public int getSubNo() {
		return subNo;
	}
	public void setSubNo(int subNo) {
		this.subNo = subNo;
	}
	public int getSubPrice() {
		return subPrice;
	}
	public void setSubPrice(int subPrice) {
		this.subPrice = subPrice;
	}
	public String getSubDate() {
		return subDate;
	}
	public void setSubDate(String subDate) {
		this.subDate = subDate;
	}
	public String getSubExpiryDate() {
		return subExpiryDate;
	}
	public void setSubExpiryDate(String subExpiryDate) {
		this.subExpiryDate = subExpiryDate;
	}
	public int getSubMonths() {
		return subMonths;
	}
	public void setSubMonths(int subMonths) {
		this.subMonths = subMonths;
	}
	public String getUserId() {
		return userId;
	}
	public void setUserId(String userId) {
		this.userId = userId;
	}
	
	
}
